import React from 'react'
import TweetEmbed from 'react-tweet-embed'
import './Board.css'


export default function Board({props}) {
  return (
        
        <div className='cover'>
        <div id='tweet'><TweetEmbed tweetId={props} options={{align: 'center'}}/></div>

        <input id='keyboard' type='text'></input>
       </div>
    )
}
